import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles((theme) => ({
  titulo: {
    fontWeight: "bold",
    border: "1px solid #FFF",
    borderRadius: "200px",
    width: "fit-content",
    padding: "10px",
    color: "#FFF",
    fontSize: "18px",
    letterSpacing: "1.5px",
  },

  header: {
    background: theme.palette.primary.main,
    display: "flex",
    justifyContent: "center",
    padding: "15px",
  },
}));
